import React, { useState } from 'react';
import Hoc
 from './Hoc';
const ClickMe = (props) => {
    
    return (
        <div>
            <button onClick={props.incrementCount}>Click</button>
            <p>{props.count}</p>
        </div>
    );
};

export default Hoc(ClickMe);
